import React from "react";
import '../Assets/smkn3makassar.png';
import './Header.css';
import { RxHamburgerMenu } from "react-icons/rx";



export const Header = () => {
  return(
    <div class="header">
    <div class="left-side">
        <h2>Nama Aplikasi</h2>
    </div>
    <div class="right-side">
        <p class="admin-text">Admin</p>
    </div>
</div>

    
  );

}
export default Header;
